import React from 'react'
import Image from './Image'

import fractal_1 from '../images/many_colorful_fractals.png'

function Fractal() {
    return (
        <div>
            <Image content={{
                source:{fractal_1},
                caption:"#"
            }}
            />
        </div>
    )
}

export default Fractal
